window.bookSummaryJSON = "<p>Those who killed their partners will wish they had never been born.</p> <p>Pain is a burned ex-mercenary. Agony is a burned ex-cop.</p> <p>Together, they might just find out. The only problem? They can't stand each other.</p> <p>Trust, it seems, doesn't come easily between a black-ops mercenary and an ex-police detective.</p> <p>What could make it worse for her? He doesn't like using guns.</p> <p>Will Pain and Agony be able to dodge the criminals trying to take them out and avoid killing each other in the process?</p> <p>Will the criminals be able to handle the two of them together?</p>"; 
